import React, { createRef, Fragment, useEffect } from "react";
import Diagram from "devextreme-react/diagram";
import "whatwg-fetch";

export const DiagramEditor = (props) => {
  const diagramRef = createRef();

  useEffect(() => {}, []);

  const onInitialized = () => {
    //alert("Diagram initialized");
  };

  return (
    <Fragment
    >
      <Diagram
        id="diagram"
        ref={diagramRef}
        onInitialized={onInitialized}
        showGrid={true}
        snapToGrid={false}
        pageOrientation={"landscape"}
        width={1100}
        height={200}
        pageWidth={1100}
        {...props}
      />
    </Fragment>
  );
};
